import React from 'react';
import { useNavigate } from 'react-router-dom';
import './InfoPage.css';

function InfoPage() {
  const navigate = useNavigate();

  return (
    <div className="info-container">
      <div className="info-box">
        <h1>About Ransomware in Healthcare</h1>
        <p>
          Ransomware is a form of malicious software that encrypts a victim's files. 
          In the healthcare sector, these attacks can jeopardize patient care and compromise sensitive data.
        </p>
        <p>
          Learn how to recognize, prevent, and respond to ransomware threats in a medical setting.
        </p>
        <button onClick={() => navigate('/')}>Back to Home</button>
      </div>
    </div>
  );
}

export default InfoPage;
